import React, {createContext} from 'react';
import FuelWiseList from 'api/fuelwiseAPI';

const FuelWiseContext = () => {
    return(
        <div>
        {Tips.map(Tip => {
          const {id, title, body} = Tip
          return (
            <Card>
            <div key={id}>
              <p style={{fontWeight: 'bold'}}>{title}</p>
              <p> {body}</p>
              </div>
              </Card>
          )
        })}
      </div>
    );
}

FuelWiseContext = createContext();
export default FuelWiseContext;
